import { useState, useEffect, useMemo } from 'react';
import LeftPanel from './components/LeftPanel';
import CenterPanel from './components/CenterPanel';
import RightPanel from './components/RightPanel';
import { useWebSocket, WebSocketMessage } from './hooks/useWebSocket';
import { useTasks } from './hooks/useTasks';
import { Task, apiService, WorkspaceConfig } from './services/api';
import { enhanceQuery } from './utils/queryEnhancer';

const STORAGE_KEY = 'orchestrator_config';

function loadConfigFromStorage(): Partial<WorkspaceConfig> | null {
  try {
    const stored = localStorage.getItem(STORAGE_KEY);
    if (stored) {
      return JSON.parse(stored);
    }
  } catch (error) {
    console.error('Failed to load config from storage:', error);
  }
  return null;
}

function App() {
  const [selectedTaskId, setSelectedTaskId] = useState<string | null>(null);
  const [leftPanelView, setLeftPanelView] = useState<'threads' | 'settings' | 'workspace' | 'observability'>('threads');
  const { tasks, addTask, updateTask, refreshTasks } = useTasks();
  const { messages, toolUses, statusChanges, logs, events } = useWebSocket(selectedTaskId);
  const [initializing, setInitializing] = useState(true);
  // Store loaded conversation history for old tasks
  const [loadedHistory, setLoadedHistory] = useState<Record<string, WebSocketMessage[]>>({});
  const [loadingHistory, setLoadingHistory] = useState<Record<string, boolean>>({});
  // Store use case ID per task (persisted in localStorage)
  const [taskUseCases, setTaskUseCases] = useState<Record<string, string>>(() => {
    try {
      const stored = localStorage.getItem('task_use_cases');
      return stored ? JSON.parse(stored) : {};
    } catch {
      return {};
    }
  });

  // Persist task use cases to localStorage
  useEffect(() => {
    try {
      localStorage.setItem('task_use_cases', JSON.stringify(taskUseCases));
    } catch (error) {
      console.error('Failed to save task use cases:', error);
    }
  }, [taskUseCases]);
  console.log("messages", messages)
  console.log("toolUses", toolUses)

  // Load conversation history when a task is selected
  useEffect(() => {
    if (!selectedTaskId) return;
    
    // #region agent log
    fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:55',message:'History load effect triggered',data:{selectedTaskId,hasLoadingState:!!loadingHistory[selectedTaskId],hasLoadedHistory:!!loadedHistory[selectedTaskId],hasWebSocketMessages:messages.some(msg => msg.taskId === selectedTaskId)},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
    // #endregion
    
    // Skip if currently loading
    if (loadingHistory[selectedTaskId]) {
      // #region agent log
      fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:59',message:'Skipping - already loading',data:{selectedTaskId},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'B'})}).catch(()=>{});
      // #endregion
      return;
    }
    
    // Check if we have WebSocket messages for this task (active task)
    const hasWebSocketMessages = messages.some(msg => msg.taskId === selectedTaskId);
    if (hasWebSocketMessages && !loadedHistory[selectedTaskId]) {
      // #region agent log
      fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:65',message:'Skipping - active task with WebSocket messages',data:{selectedTaskId,webSocketMessageCount:messages.filter(msg => msg.taskId === selectedTaskId).length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
      // #endregion
      // Active task - don't load history, use WebSocket messages
      return;
    }
    
    // If we already loaded history for this task, don't reload
    if (loadedHistory[selectedTaskId]) {
      // #region agent log
      fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:69',message:'Skipping - history already loaded',data:{selectedTaskId,loadedMessageCount:loadedHistory[selectedTaskId]?.length || 0},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
      // #endregion
      return;
    }
    
    // Load conversation history for old/completed tasks
    const loadHistory = async () => {
      // #region agent log
      fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:73',message:'Starting history load',data:{selectedTaskId},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
      // #endregion
      setLoadingHistory(prev => ({ ...prev, [selectedTaskId]: true }));
      try {
        const response = await apiService.getConversationHistory(selectedTaskId);
        // #region agent log
        fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:76',message:'API response received',data:{selectedTaskId,success:response.success,messageCount:response.messages?.length || 0,isArray:Array.isArray(response.messages)},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
        // #endregion
        if (response.success && response.messages && Array.isArray(response.messages)) {
          // Convert ApiMessage format to WebSocketMessage format
          const convertedMessages: WebSocketMessage[] = [];
          
          response.messages.forEach((msg: any, index: number) => {
            if (!msg || !msg.role) return;
            
            const timestamp = msg.ts || (Date.now() - (response.messages.length - index) * 1000);
            const isUser = msg.role === 'user';
            const isAssistant = msg.role === 'assistant';
            
            // Handle content - can be string or array of content blocks
            let contentBlocks: any[] = [];
            if (typeof msg.content === 'string') {
              contentBlocks = [{ type: 'text', text: msg.content }];
            } else if (Array.isArray(msg.content)) {
              contentBlocks = msg.content;
            }
            
            // Process each content block
            contentBlocks.forEach((block: any, blockIndex: number) => {
              if (isUser) {
                // User messages - could be text or tool_result
                if (block.type === 'text' || typeof block === 'string') {
                  const text = block.type === 'text' ? block.text : block;
                  if (text && text.trim()) {
                    convertedMessages.push({
                      type: 'taskMessage',
                      data: {
                        message: {
                          type: 'say',
                          say: 'text',
                          text: text,
                          ts: timestamp,
                        },
                        taskId: selectedTaskId,
                      },
                      timestamp: timestamp + blockIndex, // Add blockIndex to ensure unique timestamps
                      taskId: selectedTaskId,
                    });
                  }
                } else if (block.type === 'tool_result') {
                  // Tool results are handled separately via toolUses, but we can skip them here
                  // as they're typically not displayed as user messages
                }
              } else if (isAssistant) {
                // Assistant messages - could be text, tool_use, or completion_result
                if (block.type === 'text' || typeof block === 'string') {
                  const text = block.type === 'text' ? block.text : block;
                  if (text && text.trim()) {
                    // Check if this is the last assistant message with substantial content - likely completion_result
                    // Also check if previous messages suggest this is a final answer
                    const isLastMessage = index === response.messages.length - 1;
                    const isLastBlock = blockIndex === contentBlocks.length - 1;
                    const hasSubstantialContent = text.length > 50;
                    
                    // If it's the last assistant message with text and no tool_use blocks, it's likely completion_result
                    const hasToolUseBlocks = contentBlocks.some((b: any) => b.type === 'tool_use');
                    const isCompletion = isLastMessage && isLastBlock && hasSubstantialContent && !hasToolUseBlocks;
                    
                    convertedMessages.push({
                      type: 'taskMessage',
                      data: {
                        message: {
                          type: 'say',
                          say: isCompletion ? 'completion_result' : 'text',
                          text: text,
                          ts: timestamp,
                        },
                        taskId: selectedTaskId,
                      },
                      timestamp: timestamp + blockIndex,
                      taskId: selectedTaskId,
                    });
                  }
                } else if (block.type === 'tool_use') {
                  // Convert tool_use to a tool message format
                  const toolData = {
                    tool: block.name || 'unknown',
                    tool_use_id: block.id,
                    input: block.input || {},
                    content: typeof block.input === 'string' ? block.input : JSON.stringify(block.input || {}),
                  };
                  
                  convertedMessages.push({
                    type: 'taskMessage',
                    data: {
                      message: {
                        type: 'say',
                        say: 'tool',
                        text: JSON.stringify(toolData),
                        ts: timestamp,
                      },
                      taskId: selectedTaskId,
                    },
                    timestamp: timestamp + blockIndex,
                    taskId: selectedTaskId,
                  });
                }
              }
            });
          });
          
          // Filter out empty messages
          const filteredMessages = convertedMessages.filter(
            (msg: WebSocketMessage) => 
              (msg.data?.message?.text && msg.data.message.text.trim()) || 
              msg.data?.message?.say === 'completion_result' ||
              msg.data?.message?.say === 'tool'
          );
          
          console.log(`[History] Loaded ${filteredMessages.length} messages for task ${selectedTaskId}`, {
            totalApiMessages: response.messages.length,
            convertedMessages: convertedMessages.length,
            filteredMessages: filteredMessages.length,
            completionResults: filteredMessages.filter(m => m.data?.message?.say === 'completion_result').length,
          });
          
          // #region agent log
          fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:185',message:'Messages converted and filtered',data:{selectedTaskId,totalApiMessages:response.messages.length,convertedCount:convertedMessages.length,filteredCount:filteredMessages.length,completionResults:filteredMessages.filter(m => m.data?.message?.say === 'completion_result').length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'C'})}).catch(()=>{});
          // #endregion
          
          setLoadedHistory(prev => ({ ...prev, [selectedTaskId]: filteredMessages }));
          // #region agent log
          fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:189',message:'History state updated',data:{selectedTaskId,messageCount:filteredMessages.length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'B'})}).catch(()=>{});
          // #endregion
        } else {
          // #region agent log
          fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:192',message:'API response invalid',data:{selectedTaskId,success:response.success,hasMessages:!!response.messages,isArray:Array.isArray(response.messages)},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
          // #endregion
        }
      } catch (error: any) {
        console.error('Failed to load conversation history:', error);
        // #region agent log
        fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:197',message:'History load error',data:{selectedTaskId,error:error?.message || String(error)},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'A'})}).catch(()=>{});
        // #endregion
      } finally {
        setLoadingHistory(prev => {
          const updated = { ...prev };
          delete updated[selectedTaskId];
          // #region agent log
          fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:203',message:'Loading state cleared',data:{selectedTaskId},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'B'})}).catch(()=>{});
          // #endregion
          return updated;
        });
      }
    };
    
    loadHistory();
  }, [selectedTaskId, messages, loadedHistory, loadingHistory]);

  // Merge loaded history with WebSocket messages
  const allMessages = useMemo(() => {
    const merged: WebSocketMessage[] = [...messages];
    
    // Add loaded history for the selected task
    if (selectedTaskId && loadedHistory[selectedTaskId]) {
      const hasWebSocketForTask = messages.some(msg => msg.taskId === selectedTaskId);
      // If we have WebSocket messages, prefer those (active task)
      // Otherwise, use loaded history (old task)
      if (!hasWebSocketForTask) {
        merged.push(...loadedHistory[selectedTaskId]);
        // #region agent log
        fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:214',message:'Merged loaded history',data:{selectedTaskId,webSocketCount:messages.length,loadedHistoryCount:loadedHistory[selectedTaskId].length,mergedCount:merged.length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'D'})}).catch(()=>{});
        // #endregion
      } else {
        // #region agent log
        fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:217',message:'Using WebSocket messages instead of history',data:{selectedTaskId,webSocketCount:messages.length,loadedHistoryCount:loadedHistory[selectedTaskId].length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'D'})}).catch(()=>{});
        // #endregion
      }
    } else {
      // #region agent log
      fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:221',message:'No loaded history to merge',data:{selectedTaskId,hasSelectedTaskId:!!selectedTaskId,hasLoadedHistory:!!(selectedTaskId && loadedHistory[selectedTaskId]),webSocketCount:messages.length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'D'})}).catch(()=>{});
      // #endregion
    }
    
    // #region agent log
    const taskMessages = merged.filter(msg => msg.taskId === selectedTaskId || !msg.taskId);
    fetch('http://127.0.0.1:7245/ingest/866b450a-a0a7-4005-991c-f22cacb94ff5',{method:'POST',headers:{'Content-Type':'application/json'},body:JSON.stringify({location:'App.tsx:227',message:'allMessages computed',data:{selectedTaskId,totalMerged:merged.length,taskMessagesCount:taskMessages.length},timestamp:Date.now(),sessionId:'debug-session',runId:'run1',hypothesisId:'D'})}).catch(()=>{});
    // #endregion
    
    return merged;
  }, [messages, loadedHistory, selectedTaskId]);

  useEffect(() => {
    // Try to auto-initialize workspace if config exists
    const initializeWorkspaceIfNeeded = async () => {
      try {
        // First check if workspace is already initialized
        await apiService.getTasks();
        // If successful, workspace is initialized
        setInitializing(false);
      } catch (error) {
        // Workspace not initialized, try to initialize from localStorage
        const savedConfig = loadConfigFromStorage();
        if (savedConfig && savedConfig.workspacePath && savedConfig.apiProvider && savedConfig.apiKey) {
          try {
            console.log('Auto-initializing workspace from saved config...');
            await apiService.initializeWorkspace({
              workspacePath: savedConfig.workspacePath,
              apiProvider: savedConfig.apiProvider,
              apiKey: savedConfig.apiKey,
              apiModelId: savedConfig.apiModelId,
              apiBaseUrl: savedConfig.apiBaseUrl,
              organizationId: savedConfig.organizationId,
            });
            console.log('Workspace auto-initialized successfully');
          } catch (initError) {
            console.error('Failed to auto-initialize workspace:', initError);
          }
        }
        setInitializing(false);
      }
    };

    initializeWorkspaceIfNeeded();
    refreshTasks();
  }, []);

  const handleCreateTask = async (message: string, useCaseId?: string) => {
    try {
      // Enhance query with selected use case
      const enhancedMessage = enhanceQuery(message, useCaseId);

      const response = await apiService.createTask({ message: enhancedMessage });
      const newTask: Task = {
        id: response.taskId,
        task: message.substring(0, 50) + '...', // Show original message, not enhanced
        mode: 'code',
        timestamp: Date.now(),
      };
      addTask(newTask);
      setSelectedTaskId(response.taskId);
      // Store use case for this task
      if (useCaseId) {
        setTaskUseCases(prev => ({ ...prev, [response.taskId]: useCaseId }));
      }
      setLeftPanelView('threads');
    } catch (error: any) {
      console.error('Failed to create task:', error);
      const errorMessage = error.response?.data?.error || error.message || 'Failed to create task';

      // If it's a 401 or workspace not initialized error, suggest going to settings
      if (error.response?.status === 401 || errorMessage.includes('not initialized') || errorMessage.includes('API key')) {
        alert(`Error: ${errorMessage}\n\nPlease go to Orchestrator Settings and ensure:\n1. Workspace is initialized\n2. API key is configured correctly`);
        setLeftPanelView('settings');
      } else {
        alert(`Failed to create task: ${errorMessage}`);
      }
    }
  };

  const handleSendMessage = async (message: string, useCaseId?: string) => {
    if (!selectedTaskId) {
      await handleCreateTask(message, useCaseId);
      return;
    }

    try {
      // Use the use case associated with this task, or the provided one
      const taskUseCaseId = useCaseId || taskUseCases[selectedTaskId];
      const enhancedMessage = enhanceQuery(message, taskUseCaseId);

      await apiService.sendTaskMessage({
        taskId: selectedTaskId,
        message: enhancedMessage,
      });
    } catch (error: any) {
      console.error('Failed to send message:', error);
      const errorMessage = error.response?.data?.error || error.message || 'Failed to send message';
      alert(`Failed to send message: ${errorMessage}`);
    }
  };

  const handleNewThread = () => {
    setSelectedTaskId(null);
    setLeftPanelView('threads');
  };

  const handleDeleteTask = async (taskId: string) => {
    try {
      await apiService.deleteTask(taskId);
      
      // If the deleted task was selected, clear selection
      if (selectedTaskId === taskId) {
        setSelectedTaskId(null);
      }
      
      // Clear loaded history for this task
      setLoadedHistory(prev => {
        const updated = { ...prev };
        delete updated[taskId];
        return updated;
      });
      
      // Clear use case for this task
      setTaskUseCases(prev => {
        const updated = { ...prev };
        delete updated[taskId];
        return updated;
      });
      
      // Refresh task list
      await refreshTasks();
    } catch (error) {
      console.error('Failed to delete task:', error);
      alert('Failed to delete task. Please try again.');
    }
  };

  const handleDeleteChat = () => {
    if (selectedTaskId && window.confirm('Are you sure you want to delete this chat? This action cannot be undone.')) {
      handleDeleteTask(selectedTaskId);
    }
  };

  return (
    <div className="flex h-screen bg-white">
      <LeftPanel
        tasks={tasks}
        selectedTaskId={selectedTaskId}
        onSelectTask={setSelectedTaskId}
        currentView={leftPanelView}
        onViewChange={setLeftPanelView}
        onNewThread={handleNewThread}
        onDeleteTask={handleDeleteTask}
      />
      {leftPanelView === 'threads' ? (
        <>
          <RightPanel
            onSendMessage={handleSendMessage}
            taskId={selectedTaskId}
            status={statusChanges[selectedTaskId || '']}
            onDeleteChat={handleDeleteChat}
            events={events}
            messages={allMessages}
            toolUses={toolUses}
            logs={logs}
            taskUseCaseId={selectedTaskId ? taskUseCases[selectedTaskId] : undefined}
            onUseCaseChange={(useCaseId) => {
              if (selectedTaskId) {
                setTaskUseCases(prev => ({ ...prev, [selectedTaskId]: useCaseId }));
              }
            }}
            loadedHistory={loadedHistory}
            loadingHistory={loadingHistory}
          />
          <CenterPanel
            taskId={selectedTaskId}
            messages={allMessages}
            toolUses={toolUses}
            currentView={leftPanelView}
            logs={logs}
            status={statusChanges[selectedTaskId || '']}
          />
        </>
      ) : (
        <CenterPanel
          taskId={selectedTaskId}
          messages={allMessages}
          toolUses={toolUses}
          currentView={leftPanelView}
          logs={logs}
          status={statusChanges[selectedTaskId || '']}
        />
      )}
    </div>
  );
}

export default App;



